import { Box, Typography, Grid, Card, CardContent, Chip } from '@mui/material'
import { cofounders } from '../data/co-founders'

const AboutUs = () => (
  <Box
    id="about"
    sx={{
      position: 'relative',
      backgroundColor: '#F3E2D4',
      px: { xs: 4, md: 8 },
      pt: { xs: 8, md: 12 },
      pb: { xs: 0, md: 12 },
      color: '#17313E',
      textAlign: 'center',
      overflow: 'hidden',
    }}
  >
    {/* Decorative Circle Top Left */}
    <Box
      sx={{
        position: 'absolute',
        top: '-10%',
        left: '-10%',
        width: { xs: 120, md: 200 },
        height: { xs: 120, md: 200 },
        bgcolor: 'rgba(65,94,114,0.2)',
        borderRadius: '50%',
      }}
    />

    {/* Section Title */}
    <Typography
      variant="h3"
      sx={{
        fontFamily: "'DM Serif Display', serif",
        fontSize: { xs: '2rem', md: '2.75rem' },
        letterSpacing: '0.04em',
        color: '#415E72',
        mb: 2,
        textShadow: '1px 1px 4px rgba(0,0,0,0.1)',
      }}
    >
      Who We Are
    </Typography>

    {/* Mission Text */}
    <Typography
      variant="h6"
      maxWidth={800}
      mx="auto"
      sx={{
        fontFamily: 'Inter, sans-serif',
        fontWeight: 400,
        fontSize: { xs: '0.95rem', md: '1.1rem' },
        color: '#17313E',
        letterSpacing: '0.02em',
        lineHeight: 1.6,
        mb: 6,
        px: { xs: 2, md: 0 },
      }}
    >
      Odyssey of Wisdom is a youth association in Ancient Olympia, empowering underserved Greek youth through Erasmus+ travel, learning, and cultural exchange—opening doors to new horizons.
    </Typography>

    {/* Vision & Chips */}
    <Typography
      variant="h4"
      sx={{
        fontFamily: "'DM Serif Display', serif",
        fontSize: { xs: '1.75rem', md: '2rem' },
        color: '#415E72',
        mb: 3,
      }}
    >
      Our Vision & Activities
    </Typography>

    <Grid
      container
      spacing={2}
      justifyContent="center"
      sx={{ mb: 6, px: { xs: 2, md: 0 } }}
    >
      {[
        'Soft Skills',
        'AI & Innovation',
        'Sustainability',
        'Active Citizenship',
        'European Values',
        'Media & Communication',
        'Entrepreneurship',
        'Environment',
        'Leadership',
        'Non‑formal Learning',
        'Intercultural Dialogue',
        'Sports',
      ].map((topic) => (
        <Grid item key={topic}>
          <Chip
            label={topic}
            sx={{
              backgroundColor: '#415E72',
              color: '#F3E2D4',
              fontFamily: 'Inter, sans-serif',
              fontWeight: 500,
              px: 2,
              py: 1,
              borderRadius: '16px',
              boxShadow: '0 2px 6px rgba(0,0,0,0.1)',
            }}
          />
        </Grid>
      ))}
    </Grid>

    {/* Founders */}
    <Typography
      variant="h4"
      sx={{
        fontFamily: "'DM Serif Display', serif",
        fontSize: { xs: '1.75rem', md: '2rem' },
        color: '#415E72',
        mb: 4,
      }}
    >
      Meet the Founders
    </Typography>
    <Grid container spacing={4} justifyContent="center" sx={{ px: { xs: 2, md: 0 } }}>
      {cofounders.map((person) => (
        <Grid item xs={12} sm={6} md={4} key={person.name}>
          <Card
            elevation={4}
            sx={{
              borderRadius: 3,
              overflow: 'hidden',
              transition: 'transform 0.3s ease, box-shadow 0.3s ease',
              '&:hover': {
                transform: 'translateY(-6px)',
                boxShadow: '0 8px 20px rgba(0,0,0,0.15)',
              },
            }}
          >
            <Box
              component="img"
              src={person.image}
              alt={person.name}
              sx={{
                width: '100%',
                height: { xs: 240, md: 260 },
                objectFit: 'cover',
              }}
            />
            <CardContent sx={{ textAlign: 'left', p: 3 }}>
              <Typography
                variant="h6"
                sx={{
                  fontFamily: "'DM Serif Display', serif",
                  fontSize: '1.25rem',
                  mb: 1,
                  color: '#17313E',
                }}
              >
                {person.name}
              </Typography>
              <Chip
                label={person.role}
                size="small"
                sx={{
                  backgroundColor: '#C5B0CD',
                  color: '#17313E',
                  fontFamily: 'Inter, sans-serif',
                  fontWeight: 500,
                  mb: 2,
                }}
              />
              <Typography
                variant="body2"
                sx={{
                  fontFamily: 'Inter, sans-serif',
                  color: '#415E72',
                  lineHeight: 1.5,
                  display: '-webkit-box',
                  WebkitBoxOrient: 'vertical',
                  WebkitLineClamp: 4,
                  overflow: 'hidden',
                  textOverflow: 'ellipsis',
                }}
              >
                {person.bio}
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      ))}
    </Grid>

    {/* Bottom Wave SVG */}
    <Box
      component="svg"
      viewBox="0 0 1440 100"
      sx={{
        position: 'absolute',
        bottom: 0,
        left: 0,
        width: '100%',
        height: 'auto',
      }}
    >
      <path
        fill="#C5B0CD"
        d="M0,20 C360,120 1080,-80 1440,20 L1440,100 L0,100 Z"
      />
    </Box>
  </Box>
)

export default AboutUs
